import React, { useState } from 'react';
import { auth } from '../config/firebase';
import { createUserWithEmailAndPassword } from 'firebase/auth';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const LandlordSignUp = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [phone, setPhone] = useState('');
  const [propertiesOwned, setPropertiesOwned] = useState('');
  const [propertyName, setPropertyName] = useState('');
  const [propertyAddress, setPropertyAddress] = useState('');
  const [bedrooms, setBedrooms] = useState('');
  const [bathrooms, setBathrooms] = useState('');
  const [description, setDescription] = useState('');
  const [amenities, setAmenities] = useState([]);
  const [propertyCertificateNumber, setPropertyCertificateNumber] = useState('');
  const [squareFootage, setSquareFootage] = useState('');
  const [coverPhoto, setCoverPhoto] = useState(null);
  const navigate = useNavigate();

  const handleAmenityChange = (event) => {
    const value = event.target.value;
    setAmenities((prevAmenities) =>
      prevAmenities.includes(value)
        ? prevAmenities.filter((amenity) => amenity !== value)
        : [...prevAmenities, value]
    );
  };

  const handleFileChange = (e) => {
    setCoverPhoto(e.target.files[0]);
  };

  const handleSignUp = async (e) => {
    e.preventDefault();
    try {
      const userCredential = await createUserWithEmailAndPassword(auth, email, password);
      const firebaseUID = userCredential.user.uid;

      // Upload the cover photo to your server or storage service
      let coverPhotoUrl = '';
      if (coverPhoto) {
        const formData = new FormData();
        formData.append('coverPhoto', coverPhoto);

        const photoRes = await axios.post('http://localhost:5001/api/upload', formData, {
          headers: { 'Content-Type': 'multipart/form-data' }
        });

        coverPhotoUrl = photoRes.data.url; // Assume your API returns the URL of the uploaded file
      }

      // Send user data to the backend to store in MongoDB
      await axios.post('/api/users/landlord', {
        firebaseUID,
        email,
        name,
        phone,
        propertiesOwned,
        propertyName,
        propertyAddress,
        bedrooms,
        bathrooms,
        description,
        amenities,
        propertyCertificateNumber,
        squareFootage,
        coverPhoto: coverPhotoUrl
      });

      navigate('/login');
    } catch (error) {
      console.error("Error signing up:", error);
      alert(error.message);
    }
  };

  return (
    <form onSubmit={handleSignUp} encType="multipart/form-data">
      <input type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} />
      <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
      <input type="text" placeholder="Name" value={name} onChange={(e) => setName(e.target.value)} />
      <input type="text" placeholder="Phone" value={phone} onChange={(e) => setPhone(e.target.value)} />
      <input type="number" placeholder="Properties Owned" value={propertiesOwned} onChange={(e) => setPropertiesOwned(e.target.value)} />
      <input type="text" placeholder="Property Name" value={propertyName} onChange={(e) => setPropertyName(e.target.value)} />
      <input type="text" placeholder="Property Address" value={propertyAddress} onChange={(e) => setPropertyAddress(e.target.value)} />
      <input type="text" placeholder="Property Certificate Number" value={propertyCertificateNumber} onChange={(e) => setPropertyCertificateNumber(e.target.value)} />
      <input type="number" placeholder="Square Footage" value={squareFootage} onChange={(e) => setSquareFootage(e.target.value)} />
      <input type="number" placeholder="Bedrooms" min="1" max="10" value={bedrooms} onChange={(e) => setBedrooms(e.target.value)} />
      <input type="number" placeholder="Bathrooms" min="1" max="10" value={bathrooms} onChange={(e) => setBathrooms(e.target.value)} />
      <textarea placeholder="Description" maxLength="250" value={description} onChange={(e) => setDescription(e.target.value)} />

      <div>
        <label>Amenities:</label>
        <label><input type="checkbox" value="Pool" onChange={handleAmenityChange} /> Pool</label>
        <label><input type="checkbox" value="Gym" onChange={handleAmenityChange} /> Gym</label>
        <label><input type="checkbox" value="Laundry" onChange={handleAmenityChange} /> Laundry</label>
        <label><input type="checkbox" value="Dishwasher" onChange={handleAmenityChange} /> Dishwasher</label>
        <label><input type="checkbox" value="Air Conditioning" onChange={handleAmenityChange} /> Air Conditioning</label>
        <label><input type="checkbox" value="Balcony" onChange={handleAmenityChange} /> Balcony</label>
      </div>

      <input type="file" onChange={handleFileChange} />

      <button type="submit">Sign Up as Landlord</button>
    </form>
  );
};

export default LandlordSignUp;
